class ErrorSintactico < RuntimeError
  def initialize(token)
    @token = token
  end

  def to_s
    "Error de sintaxis en linea #{@token.linea}, columna #{@token.columna}, token '#{@token.contenido}' inesperado."
  end
end

class Parser < Racc::Parser

module_eval(<<'...end Parser.y/module_eval...', 'Parser.y', 196)

    def on_error(id, token, stack)
      raise ErrorSintactico.new(token)
    end

    def next_token
      
      tok = @lexer.shift

      if tok.nil?
        return [false, false]
      end
      @token.push(tok)
      return [tok.class, tok]
      
    end

    def parse(lexer)
      @yydebug = true # DEBUG
      @lexer  = lexer
      @token =[]
      begin
        ast = do_parse
      rescue ErrorSintactico => error
      end
      return ast
    end
